import React from 'react';
import './Nav.css'

function Nav()
{
    return(
    <header>
        <div>                
            <nav>
                <ul>
                    <li></li>
                    <li></li>
                    <li>Divide And Conquer</li>
                    <li>Greedy strategy</li>
                    <li>Dynamic Programming</li>
                    <li>Contact</li>
                </ul>
            </nav>
        </div>
    </header>
    );
};

export default Nav;
